// Maqueta de Cabecera:
//    h1
//    p > span     (el span mostrará la cantidad recibida por props)

import React from 'react'

export default function Cabecera(props) {
  return (
    <header>
      <h1>Carrito de compras</h1>
      <p>Cantidad de productos: <span>{props.cantidadProductos}</span></p>
    </header>
  )
}
